/* 
This function will use the custom variable "Query parameters to exclude from hit" to remove any query parameters that are present in the page location path or query(search)
*/
function() {
  return function (pathParts) {
    //console.log("filtering...");
    var filters = {{Query parameters to exclude from hit}}.split("|");
    //console.log(filters);
    var type = "query";
    var pathToFilter;
    var finalPath = "";
    if (pathParts[0][0] !== "?") {
        type = "path"
        var lastPart = pathParts.pop();
        pathToFilter = lastPart.split("&");
    } else {
        pathToFilter = pathParts;
        pathToFilter[0] = pathToFilter[0].replace("?","");
    }
    //console.log(type);
    //console.log(pathToFilter);
    // remove everything that matches the filters
    var filteredPathArray = pathToFilter.filter(function(element, index) {
        // should we keep this element or should it be removed?
        var shouldKeep = true;
        var keyValuePair = element.split('=');
        //console.log(keyValuePair);
		if (keyValuePair.length === 2) {
            for (var i = 0; i < filters.length ; i++) {
                if (keyValuePair[0] === filters[i]){
                    shouldKeep = false;
                    //console.log("trouv");
                    //console.log(filters[i]);
                }
            }
		}
        return shouldKeep;
    });

    var lastPartFiltered = filteredPathArray.join("&");

    if(type === "path"){
        pathParts.push(lastPartFiltered);

        finalPath = pathParts.join("/");
    } else if(lastPartFiltered) {
        finalPath = (lastPartFiltered[0] === "?") ? lastPartFiltered : "?" + lastPartFiltered;
    }

    return finalPath;
  }
}

function () {
  try {
    var emailRegex = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/i,
	    pathnameParts = document.location.pathname.split('/'),
		searchParts = document.location.search.split('&'),
		replaceStr = 'email@domain.com';

	for (var i = 0; i < pathnameParts.length; i++) {
		pathnameParts[i] = pathnameParts[i].replace(emailRegex, replaceStr);
	}

	for (var j = 0; j < searchParts.length; j++) {
		var keyValuePair = searchParts[j].split('=');
		if (keyValuePair.length === 2) {
			searchParts[j] = keyValuePair[0] + '=' + keyValuePair[1].replace(emailRegex, replaceStr);
		}
	}
	// remove query parameters from search and pathname (uses custom variable "Query parameters to exclude from page location" as filter)
    var filteredSearchParts = {{Page Path and Query Filter}}(searchParts);
    var filteredPathname = {{Page Path and Query Filter}}(pathnameParts);

    // return document.location.protocol + '//' + document.location.hostname + pathnameParts.join('/') + searchParts.join('&');
    return document.location.protocol + '//' + document.location.hostname + filteredPathname + filteredSearchParts + document.location.hash;
  } catch (e) {
    // Disabled as these log messages tend to fire too often, if re-enabling, remember to fix braces around CJ - FN Log
    //{ {CJ - FN Log} }('GTM CJ - Email Escape Page URL: ' + e.message);
    return document.location.protocol + '//' + document.location.hostname + document.location.pathname + document.location.search + document.location.hash;
  }
}

