/* Link Type v1.1
Returns the type of link the user has clicked on for purposes of creating GTM triggers.

Requires configuration of other variables as follows:
con_fileTypes - (RegEx) Types of files considered downloads.
con_socialNetworks - (RegEx) Domain names of social networks webpage is linking to.
con_crossDomains - (Comma delimited) Domains within companies environment.
con_siblingDomains - (Comma delimited) Associated websites, not for the purposes of xdomain tracking.

Original source author: Stephan Hamel
Documented, modified, & included by: Dave Fimek


*/
function () {
   try {
      var url={{Click URL}};
      if(!url) return 'none';
      if(/^mailto:/i.test(url)) return 'mailto';
      if(new RegExp({{CONS - File Types}},'i').test(url)) return 'download';
      if(new RegExp('^[^?]+'+location.hostname,'i').test(url)) return 'same';
      if(new RegExp('^[^?]+'+{{CONS - Social Networks}},'i').test(url)) return 'social';
      if(new RegExp('^[^?]+('+{{CONS - Cross Domains}}.replace(/,/,'|')+')','i').test(url)) return 'crossDomain';
      if(new RegExp('^[^?]+'+{{CONS - Sibling Domains}},'i').test(url)) return 'sibling';
	  if(new RegExp('mailto:([^?]+)').test(url)) return 'email';
      if(/^https*:\/\//i.test(url)) return 'outbound';
      return 'unknown';
   } catch(e) {
     // Disabled as these log messages tend to fire too often, if re-enabling, remember to fix braces around CJ - FN Log
     //{ {CJ - FN Log} }('GTM CJ - Link Type: ' + e.message);
   }
}

function () {
  return function ( obj, type, fn ) {
    if ( obj.attachEvent ) {
      obj['e'+type+fn] = fn;
      obj[type+fn] = function(){obj['e'+type+fn]( window.event );}
      obj.attachEvent( 'on'+type, obj[type+fn] );
    } else {
      obj.addEventListener( type, fn, false );
    }
  }
}

function () {
  return function ( obj, type, fn ) {
    if ( obj.detachEvent ) {
      obj.detachEvent( 'on'+type, obj[type+fn] );
      obj[type+fn] = null;
    } else {
      obj.removeEventListener( type, fn, false );
	}
  }
}

